import React, { useState } from 'react';
import './Login.css';

function Login() {
  const [isMemberLogin, setIsMemberLogin] = useState(true);

  const handleSubmit = (event) => {
    event.preventDefault();
    console.log('Login form submitted');
  };

  const toggleLogin = () => {
    setIsMemberLogin(!isMemberLogin);
  };

  return (
    <div className="login">
      <h2>{isMemberLogin ? 'Member Login' : 'Admin Login'}</h2>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="email">Email</label>
          <input type="email" id="email" name="email" required />
        </div>
        <div className="form-group">
          <label htmlFor="password">Password</label>
          <input type="password" id="password" name="password" required />
        </div>
        <button type="submit">{isMemberLogin ? 'Member Login' : 'Admin Login'}</button>
      </form>
      <div className="toggle-login">
        <p>
          {isMemberLogin ? "Don't have a member account?" : "Don't have an admin account?"}
          <button onClick={toggleLogin}>
            {isMemberLogin ? 'Sign up here' : 'Request admin access'}
          </button>
        </p>
      </div>
    </div>
  );
}

export default Login;
